q1.query:
query Page($skip: Int, $limit: Int, $where: PlanInputFilter){
  result: planPage(skip: $skip, limit: $limit, where: $where) {
	...Plan    
  }
}

fragment Plan on PlanGQLModel {
  __typename
    id
    lastchange
    name
    lessons {
      name
      id
      order
      type {
        id
      }
      length
      users {
        id
      }
      groups {
        id
      }
      facilities {
        id
      }
    }
    semester {
      id
      plans {
        id
      }
    }
}

q2.query:
query Page($skip: Int, $limit: Int, $where: PlannedLessonInputFilter){
  result: plannedLessonPage(skip: $skip, limit: $limit, where: $where) {
    ...Lesson
  }
}

fragment Lesson on PlannedLessonGQLModel {
  __typename
    id
    name
  lastchange
  rbacObject { id }
  type { id }
  order
  length
  linkedTo { __typename id name }
  linkedWith { __typename id name }
  users { id }
  groups { id }
  facilities { id }
  event { id }
  semester { id }
  plan { __typename id name }
}

q3.query:
query formPage($skip: Int, $limit: Int, $where: FormWhereFilter) {
  result: formPage(skip: $skip, limit: $limit, where: $where) {
    ...FormModel
  }
}


fragment FormModel on FormGQLModel {
  __typename
  id
  lastchange
  name
  sections {
    id name
  }

  created
  createdby { id }
  changedby { id }
  rbacobject { id }
}
